import React, { Component } from "react";
import { Card, CardBody, Media } from "reactstrap";

export class ImagenDetalle extends Component {
  render() {
    const { tarjetas, link_id } = this.props;

    var imgStyle = {
      minWidth: "128px",
    };
    return (
      <div>
        {tarjetas &&
          tarjetas
            .filter(({ _id }) => _id === link_id)
            .map(({ color, numero }) => {
              return (
                <div>
                  <Media
                    object
                    data-src={`${process.env.PUBLIC_URL}/uploads/${
                      color + numero
                    }.png`}
                  ></Media>
                  <Media left>
                    <Media
                      style={imgStyle}
                      object
                      src={`${process.env.PUBLIC_URL}/uploads/${
                        color + numero
                      }.png`}
                      alt="Generic placeholder image"
                    />
                  </Media>
                </div>
              );
            })}
      </div>
    );
  }
}

export default ImagenDetalle;
